window.bookSummaryJSON = "<p>The best-selling zombie apocalypse series in one complete set!</p> <p>It all starts with a single dead person coming back to life. Within three days, the undead have taken over most of town. Despite heroic efforts and swift initiatives from the government, disaster keeps spiraling. Soon, the infection reaches the nation's borders, threatening to become a worldwide pandemic.</p> <p>Will this be the end of mankind?</p> <p>This is the end of the world...one day at a time.</p> <p>Fans of Mark Tufo, T. W. Piperbrook, Bobby Adair, and Camille Picott will devour this action-packed zombie audiobook. And if you liked <i>The Orphans</i>, <i>Dead State</i>, or <i>The End of Everything</i>, youâ€™ll love <i>Dead Meat</i>.</p>"; 
